import React from 'react'
import './Card.css'
import more from './more.png'
import { Link } from 'react-router-dom'

const Card = (props) =>  {
  return (
      <div className="Card">
          <Link to={'/edit/:id'+ props.id}><img className="moreButton" alt="edit button" src={more} /></Link>
          <h2 className="title">{"Name: " + props.title}</h2>
          <h3 className="author">{"Speed: " + props.author}</h3>
          <h3 className="author">{"Color: " + props.description}</h3>
      </div>
  );
};

export default Card;


